external ffi.Pointer<pthread_override_s> pthread_override_qos_class_start_np(ffi.Pointer<_opaque_pthread_t> __pthread,
int __qos_class,
int __relative_priority,
);

/// !
/// @function pthread_override_qos_class_end_np
/// 
/// @abstract
/// Ends a QOS class override.
/// 
/// @discussion
/// Passing an override object returned by pthread_override_qos_class_start_np()
